import React from 'react';

export default function Header(props){
  return(
  <>
    <img src={applogo} alt="CR Framingham" className="navlogo" />
    <header className="appHeader">
      <h1>{props.navbar_title}</h1>
    </header>
    <style jsx>{`
      @media (max-width: 1199px) {
        .navlogo {
          height: 135%;
          width: auto;
          position:absolute;
          left: 38%;
          top: 5%;
        }
      }
      @media (min-width: 1200px) {
        .navlogo {
          min-height: 85px;
          height: 13.1vh;
          width: auto;
          position:absolute;
          left: 45%;
          top: 5%;
        }
      }
      .navlogo:hover {
        filter: brightness(110%);
      }
      h1 {
        font-family: Lato;
      };
      .appHeader {
          text-align: center;
          color: #4689C8;
          font-weight: 600;
        };
    `}</style>
  </>
  )
}
